Static variables are those variables that retain their values between different function calls. Static variables are initialized only once at compile time and they have internal linkage. Static variables can be either global or local.
Register variables are those variables that are stored in a register instead of RAM. The register keyword is used to declare a register variable. The compiler may not store the variable in a register, it may choose to store it in RAM if a register is not available.
Here is an example of static and register variables in C:
```
#include <stdio.h>

void func() {
    static int x = 10; // static variable
    register int y = 20; // register variable
    x++;
    y++;
    printf("x = %d, y = %d\n", x, y);
}

int main() {
    func();
    func();
    return 0;
}
```
In this example, the variable `x` is a static variable, so it retains its value between function calls. The variable `y` is a register variable, so it is stored in a register instead of RAM.

The output of this program will be:
```
x = 11, y = 21
x = 12, y = 21
```
As you can see, the value of `x` is retained between function calls, but the value of `y` is not.

Note that the `register` keyword is only a hint to the compiler, and it may not actually store the variable in a register. The `static` keyword, on the other hand, has a specific meaning and is always enforced by the compiler.

