 The entity is 7 bits long. The arraybuffer will be 1 byte long for every 8 entities.

Here is a simple example of how you could implement the pack and unpack functions in JavaScript:
```javascript
function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length);
  const view = new Uint8Array(buffer);
  let byteIndex = 0;
  let bitIndex = 0;

  for (const entity of entities) {
    // Pack id (4 bits)
    view[byteIndex] |= (entity.id & 0xF) << bitIndex;
    bitIndex += 4;
    if (bitIndex >= 8) {
      byteIndex++;
      bitIndex -= 8;
    }

    // Pack size (3 bits)
    view[byteIndex] |= (entity.size & 0x7) << bitIndex;
    bitIndex += 3;
    if (bitIndex >= 8) {
      byteIndex++;
      bitIndex -= 8;
    }
  }

  return buffer;
}

function unpackEntities(buffer) {
  const view = new Uint8Array(buffer);
  const entities = [];
  let byteIndex = 0;
  let bitIndex = 0;

  while (byteIndex < view.length) {
    const entity = {};

    // Unpack id (4 bits)
    entity.id = (view[byteIndex] >> bitIndex) & 0xF;
    bitIndex += 4;
    if (bitIndex >= 8) {
      byteIndex++;
      bitIndex -= 8;
    }

    // Unpack size (3 bits)
    entity.size = (view[byteIndex] >> bitIndex) & 0x7;
    bitIndex += 3;
    if (bitIndex >= 8) {
      byteIndex++;
      bitIndex -= 8;
    }

    entities.push(entity);
  }

  return entities;
}
```
You can use these functions like this:
```javascript
const entities = [
  { id: 1, size: 2 },
  { id: 3, size: 4 },
  { id: 5, size: 6 },
  // ...
];

const buffer = packEntities(entities);
const unpackedEntities = unpackEntities(buffer);

console.log(unpackedEntities);
```
Note that this implementation assumes that the input entities array is not empty and that the buffer is not empty. You may want to add error handling for these cases depending on your specific use case.

